35;}i:133;a:1:{s:7:"caption";s:2058:"Meet Our Community:  Johanna Silver

üåø "I write about gardening. I was in the garden department for 10 years at Sunset Magazine, beginning in the soil of the editorial test garden and culminating as the head of the department (though a friend told me it doesn‚Äôt count as the head when it‚Äôs a department of one, but anyway‚Ä¶), and I‚Äôve written two books. I love telling people‚Äôs stories of how and why they garden. At this point, those stories move me far more than any plant obsession, design-heavy story, or how-to. Plant people are the quirkiest, and I love them. As I‚Äôve fallen into cannabis gardening, the stories are unparalleled. I‚Äôm also really into farming. Anything related to small-scale farming ‚Äî peonies, tea, cannabis ‚Äî whatever. 

My first book was The Bold Dry Garden, about The Ruth Bancroft Garden. My second book, Growing Weed in the Garden, came out March 24, right when the world shut down. It‚Äôs a real gardener‚Äôs look at growing cannabis. I‚Äôm not a stoner. Please don‚Äôt be shy to check it out! I‚Äôm making videos for Leafly about how to grow cannabis in the garden.

Let‚Äôs just say my own yard in Berkeley, CA, is not magazine-ready. I rent, so there‚Äôs a constant tension around how much I want to pour into this space. I kill things. I stand and stare a lot of the time. I like some things I‚Äôve done and am still trying to figure out half the yard. I love growing cut flowers the most. Since Covid, I‚Äôve started filming my toddler son and me in the garden and posting videos on Instagram. It‚Äôs been my biggest creative outlet during this time, and though I have mixed feelings about showing off so much of my kid on social media, he might actually be the smartest, funniest child ever, so the world deserves to see him. I was raised with zero gardening influence, and it‚Äôs utterly fulfilling to think I‚Äôm giving him some exposure to cultivation."

